export const getBackgroundColor = function () {
  const memo = {};
  if (!memo[arguments.join("")]) {
    memo[arguments.join("")] = `rgb(${[
      Math.random() * 255,
      Math.random() * 255,
      Math.random() * 255,
    ].toString()})`;
  }
  return memo[arguments.join("")];
};
